// Handler creates http.Handler with routing matching OpenAPI spec.
func Handler(si ServerInterface) http.Handler {
	return HandlerWithOptions(si, StdHTTPServerOptions{})
}

// ServeMux is an abstraction of http.ServeMux.
type ServeMux interface {
	HandleFunc(pattern string, handler func(http.ResponseWriter, *http.Request))
	ServeHTTP(w http.ResponseWriter, r *http.Request)
}

type StdHTTPServerOptions struct {
	BaseURL          string
	BaseRouter       ServeMux
	Middlewares      []MiddlewareFunc
	ErrorHandlerFunc func(w http.ResponseWriter, r *http.Request, err error)
}

// HandlerFromMux creates http.Handler with routing matching OpenAPI spec based on the provided mux.
func HandlerFromMux(si ServerInterface, m ServeMux) http.Handler {
	return HandlerWithOptions(si, StdHTTPServerOptions{
		BaseRouter: m,
	})
}

func HandlerFromMuxWithBaseURL(si ServerInterface, m ServeMux, baseURL string) http.Handler {
	return HandlerWithOptions(si, StdHTTPServerOptions{
		BaseURL:    baseURL,
		BaseRouter: m,
	})
}

// HandlerWithOptions creates http.Handler with additional options
func HandlerWithOptions(si ServerInterface, options StdHTTPServerOptions) http.Handler {
	m := options.BaseRouter

	if m == nil {
		m = http.NewServeMux()
	}
	if options.ErrorHandlerFunc == nil {
		options.ErrorHandlerFunc = func(w http.ResponseWriter, r *http.Request, err error) {
			http.Error(w, err.Error(), http.StatusBadRequest)
		}
	}

	wrapper := ServerInterfaceWrapper{
		Handler:            si,
		HandlerMiddlewares: options.Middlewares,
		ErrorHandlerFunc:   options.ErrorHandlerFunc,
	}

	m.HandleFunc("GET "+options.BaseURL+"/api/v1/accounts", wrapper.ListAccounts)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/accounts", wrapper.CreateAccount)
	m.HandleFunc("DELETE "+options.BaseURL+"/api/v1/accounts/{id}", wrapper.DeleteAccount)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/accounts/{id}", wrapper.GetAccount)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/accounts/{id}/auth", wrapper.StartAccountAuth)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/accounts/{id}/auth/status", wrapper.GetAccountAuthStatus)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/agent-types", wrapper.ListAgentTypes)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/agent-types/{id}", wrapper.GetAgentType)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/auth-tasks/{id}", wrapper.GetAuthTask)
	m.HandleFunc("PATCH "+options.BaseURL+"/api/v1/auth-tasks/{id}", wrapper.UpdateAuthTask)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/nodes", wrapper.ListNodes)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/nodes/heartbeat", wrapper.NodeHeartbeat)
	m.HandleFunc("DELETE "+options.BaseURL+"/api/v1/nodes/{id}", wrapper.DeleteNode)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/nodes/{id}", wrapper.GetNode)
	m.HandleFunc("PATCH "+options.BaseURL+"/api/v1/nodes/{id}", wrapper.UpdateNode)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/nodes/{id}/auth-tasks", wrapper.GetNodeAuthTasks)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/nodes/{id}/runs", wrapper.GetNodeRuns)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/runs/{id}", wrapper.GetRun)
	m.HandleFunc("PATCH "+options.BaseURL+"/api/v1/runs/{id}", wrapper.UpdateRun)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/runs/{id}/cancel", wrapper.CancelRun)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/runs/{id}/events", wrapper.GetEvents)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/runs/{id}/events", wrapper.PostEvents)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/tasks", wrapper.ListTasks)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/tasks", wrapper.CreateTask)
	m.HandleFunc("DELETE "+options.BaseURL+"/api/v1/tasks/{id}", wrapper.DeleteTask)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/tasks/{id}", wrapper.GetTask)
	m.HandleFunc("GET "+options.BaseURL+"/api/v1/tasks/{id}/runs", wrapper.ListTaskRuns)
	m.HandleFunc("POST "+options.BaseURL+"/api/v1/tasks/{id}/runs", wrapper.CreateRun)
	m.HandleFunc("GET "+options.BaseURL+"/health", wrapper.Health)

	return m
}
